import portfolioImg from '../../images/strelka.svg';
import React from 'react';
import './Portfolio.css';

function Portfolio() {
    return (
        <section className="portfolio">
            <ul className="portfolio__info">
                <li className="portfolio__name">Статичный сайт</li>
                <img src={portfolioImg} alt="Стрелка" className="portfolio__img" />
                <li className="portfolio__name">Адаптивный сайт</li>
                <li className="portfolio__name">Одностраничное приложение</li>
            </ul>
        </section>
    );
}

export default Portfolio;
